	('2f9a228a-9f41-484f-9aee-90bddd272412', 'books', '9a5909bb-e759-44ab-b8d0-7143482f66e8', 'UPDATE', '{"id": "9a5909bb-e759-44ab-b8d0-7143482f66e8", "pages": 226, "title": "Touch", "author": "Envy Red", "isbn10": "0578072696", "isbn13": "9780578072692", "weight": 295, "binding": "Paperback", "edition": null, "featured": false, "language": "en", "overview": null, "synopsis": "Buckle your seatbelts and prepare for an exhilarating journey set in our nations capital where professionals indulge in more than their six figure careers. Through an erotic world of fantasy that almost crumbles at the hands of a sexual predator and serial killer, the shocking pasts of five individuals cross, and the page turning mystery that is Touch is told. Sidney, Nina, and Jade are three best friends from very different backgrounds who are active participants in the lifestyle, an exclusive underground swingers network, where professionals secretly gather to satisfy their carnal desires. When well known local celebrity and event planner Marcel Bennett is found brutally murdered after a lavish event, the connection to a series of serial killings is made and threatens to shake their foundation. Kenny aka King, is the troubled yet artistically talented younger brother of Sidney who is determined to shake his country roots and the demons he left behind. Will a gripping fear of success and mental baggage be his ultimate downfall or just the push he needs to move forward? Enter Devine, a local upscale health club owner, who just may be ready to settle down but not before being faced with demons from his own past including secrets held by his overbearing father, a high profiled city councilman. Watch as their pasts cross and their futures are forever altered when the mind blowing conclusion to this thrilling mystery unfolds, leaving you clinging to the edge of your seat.", "author_id": "e31e061d-a4a8-4cc8-af18-754786ad5ee3", "permalink": null, "status_id": null, "created_at": "2025-07-13T07:13:18.3